script: |
  super -f text -I q8145.spq | sort > q8145.out

inputs:
  - name: q8145.spq
    data: |
      SELECT - - 17 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN - - col0 + - + col1 + - CAST ( NULL AS INTEGER ) AND 68 * col0 + col2 + - - col0;
  - name: tab1

outputs:
  - name: q8145.out
    data: |
